/* qpsol:(h[56x56,20nz],g[56],a[98x56,208nz],lba[98],uba[98],lbx[56],ubx[56],x0[56],lam_x0[56],lam_a0[98],q[],p[])->(x[56],cost,lam_a[98],lam_x[56]) */
static int casadi_f13(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s8;
  p.sp_h = casadi_s18;
  p.sp_at = casadi_s9;
  p.sp_kkt = casadi_s24;
  p.sp_v = casadi_s25;
  p.sp_r = casadi_s26;
  p.prinv = casadi_s27;
  p.pc =  casadi_s28;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 56, d.lbz);
  } else {
    casadi_fill(d.lbz, 56, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 98, d.lbz+56);
  } else {
    casadi_fill(d.lbz+56, 98, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 56, d.ubz);
  } else {
    casadi_fill(d.ubz, 56, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 98, d.ubz+56);
  } else {
    casadi_fill(d.ubz+56, 98, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 56, d.z);
  } else {
    casadi_clear(d.z, 56);
  }
  casadi_fill(d.z+56, 98, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 56, d.lam);
  } else {
    casadi_clear(d.lam, 56);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 98, d.lam+56);
  } else {
    casadi_clear(d.lam+56, 98);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 56, res[0]);
  if (res[3]) casadi_copy(d.lam, 56, res[3]);
  if (res[2]) casadi_copy(d.lam+56, 98, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

/* solver:(x0[56],p[16],lbx[56],ubx[56],lbg[98],ubg[98],lam_x0[56],lam_g0[98])->(x[56],f,g[98],lam_x[56],lam_g[98],lam_p[16]) */
static int casadi_f3(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  casadi_int iter_count=0, ls_iter=0, *m_iw;
  casadi_real F_sens, du_inf, dx_norminf, fk_cand, l1, l1_cand, l1_infeas, m_f, **m_res=res+6, *m_w, pr_inf, sigma=0.0, t=0.0, tl1;
  const casadi_real **m_arg=arg+8, *m_p=arg[1], one=1;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_sqpmethod_data d;
  struct casadi_sqpmethod_prob p;
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 56;
  p_nlp.ng = 98;
  p_nlp.np = 16;
  casadi_nlpsol_init(&d_nlp, &iw, &w);
  if (arg[0]) {
    casadi_copy(arg[0], 56, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 56);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 56, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 56);
  }
  if (arg[7]) {
    casadi_copy(arg[7], 98, d_nlp.lam+56);
  } else {
    casadi_clear(d_nlp.lam+56, 98);
  }
  if (arg[2]) {
    casadi_copy(arg[2], 56, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 56, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 56, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 56, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 98, d_nlp.lbz+56);
  } else {
    casadi_fill(d_nlp.lbz+56, 98, -casadi_inf);
  }
  if (arg[5]) {
    casadi_copy(arg[5], 98, d_nlp.ubz+56);
  } else {
    casadi_fill(d_nlp.ubz+56, 98, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s18;
  p.sp_a = casadi_s8;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(&d, &iw, &w);
  m_w = w;
  m_iw = iw;
  casadi_clear(d.dx, 56);
  /* MAIN OPTIMIZATION LOOP */
  while (1) {
    /* Evaluate f, g and first order derivative information */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_res[0] = &m_f;
    m_res[1] = d.gf;
    m_res[2] = d_nlp.z+56;
    m_res[3] = d.Jk;
    if (casadi_f6(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Evaluate the gradient of the Lagrangian */
    casadi_copy(d.gf, 56, d.gLag);
    casadi_mv(d.Jk, casadi_s8, d_nlp.lam+56, d.gLag, 1);
    casadi_axpy(56, 1.0, d_nlp.lam, d.gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(154, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(56, d.gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(56, d.dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_arg[2] = &one;
    m_arg[3] = d_nlp.lam+56;
    m_res[0] = d.Bk;
    if (casadi_f9(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 154, d.lbdz);
    casadi_axpy(154, -1.0, d_nlp.z, d.lbdz);
    casadi_copy(d_nlp.ubz, 154, d.ubdz);
    casadi_axpy(154, -1.0, d_nlp.z, d.ubdz);
    /* Initial guess */
    casadi_copy(d_nlp.lam, 154, d.dlam);
    casadi_clear(d.dx, 56);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    m_arg[0] = 0;
    m_arg[1] = 0;
    m_arg[2] = 0;
    m_arg[3] = 0;
    m_arg[4] = 0;
    m_arg[5] = 0;
    m_arg[6] = 0;
    m_arg[7] = 0;
    m_arg[8] = 0;
    m_arg[9] = 0;
    m_arg[10] = 0;
    m_arg[11] = 0;
    m_arg[0] = d.Bk;
    m_arg[1] = d.gf;
    m_arg[7] = d.dx;
    m_arg[8] = d.dlam;
    m_arg[9] = d.dlam+56;
    m_arg[5] = d.lbdz;
    m_arg[6] = d.ubdz;
    m_arg[2] = d.Jk;
    m_arg[3] = d.lbdz+56;
    m_arg[4] = d.ubdz+56;
    m_res[0] = 0;
    m_res[1] = 0;
    m_res[2] = 0;
    m_res[3] = 0;
    m_res[0] = d.dx;
    m_res[3] = d.dlam;
    m_res[2] = d.dlam+56;
    casadi_f13(m_arg, m_res, m_iw, m_w, 0);
    /* Detecting indefiniteness */
    /* Calculate penalty parameter of merit function */
    sigma = casadi_fmax(sigma, (1.01*casadi_norm_inf(154, d.dlam)));
    /* Calculate L1-merit function in the actual iterate */
    l1_infeas = casadi_sum_viol(154, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* Right-hand side of Armijo condition */
    F_sens = casadi_dot(56, d.dx, d.gf);
    tl1 = F_sens - sigma * l1_infeas;
    l1 = m_f + sigma * l1_infeas;
    /* Stepsize */
    t = 1.0;
    /* Merit function value in candidate */
    l1_cand = 0.0;
    /* Reset line-search counter, success marker */
    ls_iter = 0;
    /* Line-search loop */
    while (1) {
      /*  Increase counter */
      ls_iter++;
      /* Candidate step */
      casadi_copy(d_nlp.z, 56, d.z_cand);
      casadi_axpy(56, t, d.dx, d.z_cand);
      /* Evaluating objective and constraints */
      m_arg[0] = d.z_cand;
      ;m_arg[1] = m_p;
      ;m_res[0] = &fk_cand;
      ;m_res[1] = d.z_cand+56;
      ;if (casadi_f4(m_arg, m_res, m_iw, m_w, 0)) {
        /* Avoid infinite recursion */
        if (ls_iter == 3) {
          break;
        }
        /* line-search failed, skip iteration */
        t = 0.8* t;
        continue;
      }
      /* Calculating merit-function in candidate */
      l1_cand = fk_cand + sigma * casadi_sum_viol(154, d.z_cand, d_nlp.lbz, d_nlp.ubz);
      if (l1_cand <= l1 + t * 0.0001* tl1) {
        break;
      }
      /* Line-search not successful, but we accept it. */
      if (ls_iter == 3) {
        break;
      }
      /* Backtracking */
      t = 0.8* t;
    }
    /* Candidate accepted, update dual variables */
    casadi_scal(154, 1-t, d_nlp.lam);
    casadi_axpy(154, t, d.dlam, d_nlp.lam);
    casadi_scal(56, t, d.dx);
    /* Take step */
    casadi_axpy(56, 1.0, d.dx, d_nlp.z);
  }
  m_arg[0] = d_nlp.z;
  m_arg[1] = m_p;
  m_arg[2] = &one;
  m_arg[3] = d_nlp.lam+56;
  m_res[0] = 0;
  m_res[1] = 0;
  m_res[2] = 0;
  m_res[3] = d_nlp.lam_p;
  if (casadi_f11(m_arg, m_res, m_iw, m_w, 0)) return 1;
  casadi_scal(16, -1.0, d_nlp.lam_p);
  if (res[0]) casadi_copy(d_nlp.z, 56, res[0]);
  if (res[2]) casadi_copy(d_nlp.z+56, 98, res[2]);
  if (res[3]) casadi_copy(d_nlp.lam, 56, res[3]);
  if (res[4]) casadi_copy(d_nlp.lam+56, 98, res[4]);
  if (res[5]) casadi_copy(d_nlp.lam_p, 16, res[5]);
  if (res[1]) casadi_copy(&m_f, 1, res[1]);
  return 0;
}

